import React, { useState } from 'react';

function Header() {
  // 각 메뉴에 대한 하위 메뉴 표시 여부를 관리하는 상태 변수
  const [activeMenu, setActiveMenu] = useState(null);

  // 마우스가 메뉴 위에 올라가면 하위 메뉴를 표시
  const handleMouseEnter = (menu) => {
    setActiveMenu(menu);
  };

  // 마우스가 메뉴를 벗어나면 하위 메뉴를 숨김
  const handleMouseLeave = () => {
    setActiveMenu(null);
  };

  return (
    <header style={styles.header}>
      {/* 로고와 첫 번째 메뉴바 */}
      <div style={styles.logoNavContainer}>
        <h1 style={styles.logo}>My Website</h1>
        <nav>
          <ul style={styles.navList}>
            <li style={styles.navItem}><a href="/">Home</a></li>
            <li style={styles.navItem}><a href="/about">About</a></li>
            <li style={styles.navItem}><a href="/services">Services</a></li>
            <li style={styles.navItem}><a href="/contact">Contact</a></li>
          </ul>
        </nav>
      </div>

      {/* 이미지 추가 */}
      <div style={styles.imageContainer}>
        <img src="/images/환경 로고 1.png" width="300px" alt="logo" style={styles.image} />
      </div>

      {/* 두 번째 메뉴바 */}
      <nav>
        <ul style={styles.secondNavList}>
          <li
            style={styles.navItem}
            onMouseEnter={() => handleMouseEnter('zero-donghaeng')}
            onMouseLeave={handleMouseLeave}
          >
            <a href="/zero-donghaeng">제로동행</a>
            {activeMenu === 'zero-donghaeng' && (
              <ul style={styles.subMenu}>
                <li><a href="/sub1">하위 메뉴 1</a></li>
                <li><a href="/sub2">하위 메뉴 2</a></li>
              </ul>
            )}
          </li>
          <li
            style={styles.navItem}
            onMouseEnter={() => handleMouseEnter('eco-news')}
            onMouseLeave={handleMouseLeave}
          >
            <a href="/eco-news">에코뉴스</a>
            {activeMenu === 'eco-news' && (
              <ul style={styles.subMenu}>
                <li><a href="/sub1">하위 메뉴 1</a></li>
                <li><a href="/sub2">하위 메뉴 2</a></li>
              </ul>
            )}
          </li>
          <li
            style={styles.navItem}
            onMouseEnter={() => handleMouseEnter('zero-news')}
            onMouseLeave={handleMouseLeave}
          >
            <a href="/zero-news">제로소식</a>
            {activeMenu === 'zero-news' && (
              <ul style={styles.subMenu}>
                <li><a href="/sub1">하위 메뉴 1</a></li>
                <li><a href="/sub2">하위 메뉴 2</a></li>
              </ul>
            )}
          </li>
          <li
            style={styles.navItem}
            onMouseEnter={() => handleMouseEnter('zero-activity')}
            onMouseLeave={handleMouseLeave}
          >
            <a href="/zero-activity">제로활동</a>
            {activeMenu === 'zero-activity' && (
              <ul style={styles.subMenu}>
                <li><a href="/sub1">하위 메뉴 1</a></li>
                <li><a href="/sub2">하위 메뉴 2</a></li>
              </ul>
            )}
          </li>
          <li
            style={styles.navItem}
            onMouseEnter={() => handleMouseEnter('zero-consumer')}
            onMouseLeave={handleMouseLeave}
          >
            <a href="/zero-consumer">제로슈머</a>
            {activeMenu === 'zero-consumer' && (
              <ul style={styles.subMenu}>
                <li><a href="/sub1">하위 메뉴 1</a></li>
                <li><a href="/sub2">하위 메뉴 2</a></li>
              </ul>
            )}
          </li>
        </ul>
      </nav>
    </header>
  );
}

const styles = {
  header: {
    padding: '10px 20px',
    backgroundColor: '#333',
    color: 'white',
  },
  logoNavContainer: {
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  logo: {
    fontSize: '24px',
    fontWeight: 'bold',
  },
  navList: {
    display: 'flex',
    listStyle: 'none',
    margin: 0,
    padding: 0,
  },
  navItem: {
    marginLeft: '20px',
    position: 'relative',
  },
  link: {
    color: 'white',
    textDecoration: 'none',
  },
  imageContainer: {
    textAlign: 'center',
    marginTop: '10px',
  },
  image: {
    maxWidth: '100%',
    height: 'auto',
  },
  secondNavList: {
    display: 'flex',
    width:'auto',
    justifyContent: 'space-around',
    listStyle: 'none',
    margin: '20px 0 0 0',
    padding: 0,
    backgroundColor: '#444',
  },
  subMenu: {
    position: 'absolute',
    top: '100%',
    left: 0,
    backgroundColor: '#666',
    listStyle: 'none',
    padding: '10px',
    margin: 0,
    display: 'block',
    boxShadow: '0px 4px 8px rgba(0, 0, 0, 0.2)',
  },
};

export default Header;
